    vbic q<T3>, q<B0>, q<B4>
    veor q<A3>, q<B3>, q<T3>
    vstrw.32 q<A3>, [\state, #A__3\y]  // @slothy:writes=A\state\()__3\y
    vbic q<T4>, q<B1>, q<B0>
